import Layout from '../components/Layout';

const PostLink = props => {
    <li>
        <Link href={`/post?title=${props.title}`}>
        <a>{props.title}</a>
        </Link>
    </li>
}

const Index = ()=> {
    return(
        <Layout>
            <p>Hello Next.js</p>
        </Layout>
    );
}
export default Index
